import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { Provider, useSelector } from "react-redux";
import reduxStore from "./redux";

ReactDOM.render(
  <Provider store={reduxStore}>
  <App/>
  </Provider>,
  document.getElementById("root")
);
